      return (
          <div className="navBar">
              <nav className="">
                  <a>
                  <Link to="/" className="" >
                    Home
                </Link>
                  </a>
                
                
            <a>
            <Link to="/wall" className="Link">Wall</Link>
            </a>
            <a>
            <Link to="/explore" className="Link">Explore</Link>
            </a>
            <a>
            <Link to="/mypost" className="Link">My Post</Link>
            </a>
                <a>
                <Link to="/profile" className="Link">Profile</Link>
                </a>
        
    
                
        
        
                
        
        
                
            
     
              </nav>
          </div>
      )
  }
}
